/*===Put imports here===*/
import React from "react";
import jsPDF from "jspdf";
/*===Start code here===*/

let HAV =
  "data:image/jpeg;base64,";
let SCU =
  "data:image/jpeg;base64,";
let VIN =
  "data:image/jpeg;base64,";
const createPDF = (globalTrip) => {
  var doc = new jsPDF();
  //let dataPDF = globalTrip.globalTrip;
  globalTrip.globalTrip.map((item, i) => {
    console.log("Das ist das Printitem", item);
    if (i != 7) {
      if (item.identifier === "HAV") {
        return (
          doc.addImage(HAV, "JPEG", 20, i * 40 + 20, 40, 30),
          doc.text(80, i * 40 + 30, i + 1 + "." + item.name),
          doc.text(80, i * 40 + 40, "from: " + item.fromDeutsch),
          doc.text(80, i * 40 + 50, "to: " + item.toDeutsch)
        );
      } else if (item.identifier === "VIN") {
        return (
          doc.addImage(VIN, "JPEG", 20, i * 40 + 20, 40, 30),
          doc.text(80, i * 40 + 30, i + 1 + "." + item.name),
          doc.text(80, i * 40 + 40, "from: " + item.fromDeutsch),
          doc.text(80, i * 40 + 50, "to: " + item.toDeutsch)
        );
      } else if (item.identifier === "SCU") {
        return (
          doc.addImage(SCU, "JPEG", 20, i * 40 + 20, 40, 30),
          doc.text(80, i * 40 + 30, i + 1 + "." + item.name),
          doc.text(80, i * 40 + 40, "from: " + item.fromDeutsch),
          doc.text(80, i * 40 + 50, "to: " + item.toDeutsch)
        );
      } else {
        return;
      }
    } else {
      if (item.identifier === "HAV") {
        return (
          doc.addImage(HAV, "JPEG", 20, i * 40 + 20, 40, 30),
          doc.text(80, i * 40 + 30, i + 1 + "." + item.name),
          doc.text(80, i * 40 + 40, "from: " + item.fromDeutsch),
          doc.text(80, i * 40 + 50, "to: " + item.toDeutsch),
          doc.addPage()
        );
      } else if (item.identifier === "VIN") {
        return (
          doc.addImage(VIN, "JPEG", 20, i * 40 + 20, 40, 30),
          doc.text(80, i * 40 + 30, i + 1 + "." + item.name),
          doc.text(80, i * 40 + 40, "from: " + item.fromDeutsch),
          doc.text(80, i * 40 + 50, "to: " + item.toDeutsch),
          doc.addPage()
        );
      } else if (item.identifier === "SCU") {
        return (
          doc.addImage(SCU, "JPEG", 20, i * 40 + 20, 40, 30),
          doc.text(80, i * 40 + 30, i + 1 + "." + item.name),
          doc.text(80, i * 40 + 40, "from: " + item.fromDeutsch),
          doc.text(80, i * 40 + 50, "to: " + item.toDeutsch),
          doc.addPage()
        );
      } else {
        return;
      }
    }
  });
  /*doc.text(20, 20, "1. " + globalTrip.globalTrip[0].name);
  doc.text(20, 30, "from: " + globalTrip.globalTrip[0].fromDeutsch);
  doc.text(80, 30, "from: " + globalTrip.globalTrip[0].toDeutsch);
*/
  doc.save("generated.pdf");
};

export default function PDFCreator(globalTrip) {
  console.log(globalTrip);
  if (globalTrip.globalTrip.length >= 1) {
    return <button onClick={() => createPDF(globalTrip)}>Save as PDF</button>;
  } else {
    return "";
  }
}

